import React, {Fragment} from "react";
import styled from "styled-components";
import "bootstrap/dist/css/bootstrap.min.css";
import Container from "react-bootstrap/Container"
import Row from "react-bootstrap/Row";
import Col from "react-bootstrap/Col";
import infopic1 from "../img/infopic1.jpg"

const Infographic = () => {
  return (
<Fragment> 
<Container fluid style={{backgroundColor:'red'}}> 


<Row className="justify-content-md-center" style={{justifyContent:"center"}}>
    <Col> 
    <Row className="d-flex justify-content-center center-block d-block m-auto"> <img src={infopic1} alt="Logo" className="infopic1" /></Row>
    <Row><h2>Fly Safe</h2></Row>
    <Row> <p> Through collaborations with airlines around the world, TravelBuddy offers you the best price across millions of flights to create your perfect trip</p></Row>

    </Col>

    <Col>2 of 3</Col>


    <Col>3 of 3</Col>
  </Row>

</Container> 
</Fragment> 
  );
};

export default Infographic;
